import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { CircularProgress, Rating } from "@mui/material";
import styled from "styled-components";
import {
  AddShoppingCartOutlined,
  FavoriteBorder,
  FavoriteRounded,
} from "@mui/icons-material";
import { useDispatch } from "react-redux";
import { openSnackbar } from "../../redux/reducers/snackbarSlice";
import {
  addToCart,
  addToFavourite,
  deleteFromFavourite,
  getFavourite,
} from "../../api";

const Card = styled.div`
  width: 250px;
  min-height: 250px;
  display: flex;
  flex-direction: column;
  gap: 8px;
  transition: all 0.3s ease-out;
  cursor: pointer;
  background: white;
  border-radius: 10px;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
`;

const Image = styled.img`
  width: 100%;
  height: 150px;
  border-radius: 10px 10px 0 0;
  object-fit: cover;
  transition: all 0.3s ease-out;
`;

const Menu = styled.div`
  position: absolute;
  z-index: 10;
  color: ${({ theme }) => theme.text_primary};
  top: 8px;
  right: 8px;
  display: none;
  flex-direction: column;
  gap: 8px;
`;

const MenuItem = styled.div`
  border-radius: 50%;
  width: 28px;
  height: 28px;
  background: white;
  padding: 6px;
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 200;
  cursor: pointer;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);

  &:hover {
    transform: scale(1.1);
  }
`;

const Rate = styled.div`
  position: absolute;
  z-index: 10;
  color: ${({ theme }) => theme.text_primary};
  bottom: 6px;
  left: 6px;
  padding: 4px 8px;
  border-radius: 6px;
  background: white;
  display: flex;
  align-items: center;
  opacity: 0.9;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
`;

const Top = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  min-height: 150px;
  border-radius: 10px 10px 0 0;
  overflow: hidden;

  &:hover {
    ${Image} {
      transform: scale(1.05);
    }
    ${Menu} {
      display: flex;
    }
  }
`;

const Details = styled.div`
  display: flex;
  gap: 6px;
  flex-direction: column;
  padding: 8px;
  min-height: 100px;
`;

const Title = styled.div`
  font-size: 14px;
  font-weight: 600;
  color: ${({ theme }) => theme.text_primary};
`;

const Desc = styled.div`
  font-size: 12px;
  font-weight: 400;
  color: ${({ theme }) => theme.text_secondary};
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
`;

const Location = styled.div`
  width: fit-content;
  font-size: 11px;
  font-weight: 500;
  padding: 3px 8px;
  border-radius: 16px;
  background: ${({ theme }) => theme.disabled + 50};
  color: ${({ theme }) => theme.text_secondary};
`;

const Price = styled.div`
  display: flex;
  align-items: center;
  gap: 8px;
  font-size: 16px;
  font-weight: 600;
  color: ${({ theme }) => theme.text_primary};
  margin-top: auto;
`;

const Strike = styled.div`
  font-size: 13px;
  font-weight: 500;
  color: ${({ theme }) => theme.text_secondary + 60};
  text-decoration: line-through;
  text-decoration-color: ${({ theme }) => theme.text_secondary + 50};
`;

const Percent = styled.div`
  font-size: 12px;
  font-weight: 500;
  color: #00a650;
  background: #e3f5eb;
  padding: 2px 6px;
  border-radius: 4px;
`;

const PropertyCard = ({ property }) => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate(`/property/${property._id}`);
  };

  return (
    <Card onClick={handleClick}>
      <Top>
        <Image src={property?.img} />
        <Menu>
          <MenuItem>
            <FavoriteBorder sx={{ fontSize: "16px" }} />
          </MenuItem>
        </Menu>
        <Rate>
          <Rating value={Number(property?.rating)} sx={{ fontSize: "14px" }} readOnly />
        </Rate>
      </Top>
      <Details>
        <Title>{Property?.title}</Title>
        <Desc>{property?.desc}</Desc>
        <Location>{property?.location}</Location>
        <Price>
          ${property?.price?.org}
          <Strike>${property?.price?.mrp}</Strike>
          <Percent>{property?.price?.off}% OFF</Percent>
        </Price>
      </Details>
    </Card>
  );
};

export default PropertyCard;
